@RestController
public class TestController {

    /**
     * 1、经典的注解引入方式 就是在@Configuration注解下生存bean
     */
    @Autowired
    private ConfigBean configBean;
    @Autowired
    private AbstractPDFProcessor abstractPDFProcessor;

    @GetMapping(path = "/bean1")
    public void testPhoto() throws Exception {

        String s  = "{  \"frontPhoto\": \"\"}";

        UserPhotoInfo userPhotoInfo =  JSON.parseObject(s,new TypeReference<UserPhotoInfo>(){});
        HomeBO bo = new HomeBO();
        if (userPhotoInfo != null) {
            bo.setFrontPhoto(userPhotoInfo.getFrontPhoto());
            bo.setFrontPhotoName("98f2fe59df1c2fe30ace26aee1fd5fe8_0.jpg");
            bo.setBackPhoto(userPhotoInfo.getBackPhoto());
            bo.setBackPhotoName(userPhotoInfo.getBackPhotoName());
            bo.setGender("男");
            bo.setRealName("周贵龙");
            bo.setIdNo("1235563ss464");
        }

        String frontPhotoPath = FileSystemView.getFileSystemView().getHomeDirectory().getPath() + "\\" + File.separator + bo.getFrontPhotoName();
        String backPhotoPath = FileSystemView.getFileSystemView().getHomeDirectory().getPath() + "\\" + File.separator + bo.getBackPhotoName();
        if (bo.getFrontPhoto() != null && StringUtils.isNotEmpty(bo.getFrontPhotoName())) {
            try (OutputStream out = new FileOutputStream(frontPhotoPath)) {
                IOUtils.write(bo.getFrontPhoto(), out);
                bo.setFrontPhotoPath(frontPhotoPath);
            }
            int length = bo.getFrontPhoto().length;
            System.out.println(length);
        }
        if (bo.getBackPhoto() != null && StringUtils.isNotEmpty(bo.getBackPhotoName())) {
            try (OutputStream out = new FileOutputStream(backPhotoPath)) {
                IOUtils.write(bo.getBackPhoto(), out);
                bo.setBackPhotoPath(backPhotoPath);
            }
        }

        abstractPDFProcessor.genPDFAndSign(bo, "home.vm", "07_户籍信息","10832860-271954");
//        log.info("ruleFieldList--------------");
    }


}
